import React, { Component } from 'react';
// import logo from './logo.svg';
// import './App.css';
import InputBuilder from './Input';
const data = [{
  "type": "text",
  "name": "FirstName",                    
  "classname": "text",
  "placeholder": "Enter first name",

},
{
  "type": "text",
  "name": "Surname",                  
  "classname": "text",
  "placeholder": "Enter surname"

},
{
  "type": "text",
  "name": "Start Date",                  
  "classname": "text",
  "placeholder": "Enter surname",
  "value": "2018/12/15"
},
{
  "type": "submit",
  "name": "send",                  
  "classname": "text"
}
]

class App extends Component {
  render() {
    return data.map((input, i) => {
      return <div className="App"><InputBuilder key={i} params={input} /></div> 
    });
  }
}

export default App;
